import { StyleSheet } from "react-native";  

const styles = StyleSheet.create({
    containerCart: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center'
    },
    item1: {
        width: '20%',
    },
    img: {
        width: 80,
        height: 100,
        borderRadius: 16
    },
    item2: {
        width: '50%'
    },
    item3: {
        width: '20%'
    },
    imgShiper: {
        width: 24,
        height: 24
    }
});

export default styles;
